function is_prime = is_prime_number(n)
  if n <= 1
    is_prime = false;
  elseif n == 2
    is_prime = true;
  elseif mod(n, 2) == 0
    is_prime = false;
  else
    k = 3;
    while k^2 <= n
      if mod(n, k) == 0
        is_prime = false;
        return;
      endif
      k += 2;
    endwhile
    is_prime = true;
  endif
endfunction

function is_valid = is_valid_set(x)
  set = [2, 4, 10, x];
  for i = 1:4
    for j = 1:4
      for k = 1:4
        if i != j && j != k && k != i
          sum = set{i} + set{j} + set{k} + 1;
          if !is_prime_number(sum)
            is_valid = false;
            return;
          endif
        endif
      endfor
    endfor
  endfor
  is_valid = true;
endfunction

x = 11;
while !is_valid_set(x)
  x += 1;
endwhile
x
```

