function result = check_sequence(seq)
  n = length(seq);
  valid = true;
  for i = 1:n-1
    if abs(seq(i) - seq(i+1)) > 1
      valid = false;
      break;
    end
  end
  if valid
    sums = [];
    for i = 1:n
      for j = i+1:n
        sums = [sums; seq(i) + seq(j)];
      end
    end
    unique_sums = unique(sums);
    if length(unique_sums) < length(sums)
      valid = true;
    else
