function vertices = calculate_vertices(edges)
  % Calculate the number of vertices in a pyramid given the number of edges
  % A pyramid has a base and a number of triangular faces equal to the number of edges
  % Each triangular face has 3 vertices, and the base has the same number of vertices as the number of edges
  % However, each vertex is shared by 3 faces, so we need to divide the total number of vertices by 3
