% Calculate the vector from the start point to the point on ell
vector_to_ell = point_on_ell - start_point;

% Calculate the projection of the vector to ell onto the direction vector
projection = dot(vector_to_ell, direction_vector) / dot(direction_vector, direction_vector) * direction_vector;

