In this case, we want to find the number of ways to choose 5 players out of 10 for one team, and the remaining 5 players will automatically form the other team. This is a combination problem because the order in which we choose the players does not matter.

In GNU Octave, we can use the `nchoosek` function to calculate combinations. The `nchoosek` function takes two arguments: the total number of items (in this case, 10 players), and the number of items to choose (in this case, 5 players).

So, the programmatic solution in GNU Octave would be:

```octave
total_players = 10;
players_per_team = 5;
number_of_ways = nchoosek(total_players, players_per_team);
