The volume of a cone is given by the formula V = (1/3)rh, where r is the radius and h is the height. In this case, the radius is half the side length of the equilateral triangle (since the triangle is rotated about an altitude), and the height is the altitude of the triangle.

Here is a simple Octave script that calculates the volume:

```octave
% Define the side length of the equilateral triangle
side = 12;

% Calculate the radius (half the side length)
radius = side / 2;

% Calculate the height of the equilateral triangle
height = sqrt(3) * radius;

% Calculate the volume of the cone
volume = (1/3) * pi * radius^2 * height;

% Display the result
disp(volume);
```

