rationale:
We let the $x$-axis represent the time Alice arrives at the party, and we let the $y$-axis represent the time Bob arrives at the party. Then we shade in the area where the number of minutes Alice is late for the party plus the number of minutes Bob is late for the party is less than 45.

[asy]
draw((0,0)--(0,60));
draw((0,60)--(60,60)--(60,0));
draw((0,0)--(60,0));
label("5:00", (0,0), SW);
label("6:00", (0,60), W);
label("6:00", (60,0), S);

fill((0,0)--(45,0)--(0,45)--cycle, gray(.7));
[/asy]

If we let 1 unit be one minute, the area of the shaded region is $\frac{45^2}{2}$ square units and the whole area is 3600 square units. Therefore, the probability that a randomly chosen point will land in the shaded region is $\frac{45^2}{2\cdot 3600}={32}}$.

